import { connect } from 'http2';
import { bindActionCreators } from 'redux';

class LeftContent extends Component {
 constructor(props) {
   super(props)
 
   this.state = {
      
   }
 }
 
  tabRow =(news)=>{
      news.map((newz,i)=>{
          return <TableRowContent key={i} newz={newz} index={i}/>
      }) 
  }
  render() {
    return (
     <div>
        {this.tabRow(news)}
     </div>
    )
  }
}
